    &.bottom-right{
      bottom: 0;
      transform: translate(0, calc(100% + 10px));
      left: 0;

      &:before{
        top: -5px;
      }
    }

    &.bottom-left{
      bottom: 0;
      transform: translate(0, calc(100% + 10px));
      right: 0;

      &:before{
        right: 5px;
        top: -5px;
      }
    }
  }

}

